function getUnreadMessage(e){let n=SYSTEM_REAL_TIME_URL+("/api/admin/unread?refresh="+e);fetch(n,{method:"GET",headers:{"Content-Type":"application/json"}}).then(e=>e.json()).then(e=>{200==e.code?(console.log(e.code),fillUnreadMsg(e.data)):($("#msg-user-unread").text(0),$("#msg-admin-unread").text(0))}).catch(e=>!1)}function fillUnreadMsg(e){if(e){console.log(e);let n=e.countUser.length,t=e.countAdmin.length;n>9&&(n="9+"),t>9&&(t="9+"),$("#msg-user-unread").text(n),$("#msg-admin-unread").text(t)}}$(document).ready(function(){getUnreadMessage(REFRESH)});